Actionscript.script:
_root.stop();
var _loc1_ = new LoadVars();
_loc1_.onLoad = function(success)
{
	if (success)
	{
		_root.gotoAndStop("多语言");
		delete _loc1_;
	}
	else
	{
		_root.unloadMovie();
		_root.loadMovie("flashswf/UI/验证失败界面.swf")
	}
};
_loc1_.load('../CrazyFlasher7StandAloneStarter.exe');
